import React from 'react'

const Github = () => {
    return (
        <div className="github">
            <h2>Github Account</h2><br></br>
            <p>
                <a href="https://github.com/littlepotato123">Go To My Github Pages</a><br></br>
            </p>
        </div>
    );
}

export default Github;
